import{_ as t}from"./chunks/theme.C06NILu8.js";import{_ as n,a as s,J as r,f as a,o as i}from"./chunks/framework.BWf-PbcG.js";const l="/assets/floor.DQ0XVcfA.png",_=JSON.parse('{"title":"TechShop, USA","description":"","frontmatter":{"title":"TechShop, USA","date":"2014-10-31","cover":"techshop.jpg","youtube":"http://www.youtube.com/watch?v=ls9xwt6F3mo"},"headers":[],"relativePath":"theory/research/techshop-usa/index.md","filePath":"theory/research/techshop-usa/index.md"}'),p={name:"theory/research/techshop-usa/index.md"};function c(h,e,g,u,m,d){const o=t;return i(),s("div",null,[e[0]||(e[0]=r('<p><a href="http://www.techshop.ws" class="external-link" target="_blank" rel="noreferrer">www.techshop.ws</a></p><p>Американский пионер в области универсальных мастерских, предоставляющих доступ к широкому спектру компьютеризированного оборудования за небольшую абонентскую плату.</p><blockquote><p>Get access to over $1 million dollars worth of advanced machines and tools, sophisticated 2D and 3D design software, and other professional equipment for a very low monthly membership fee.</p></blockquote><p><img src="'+l+'" alt="Примерный план TechShop"></p><h3 id="_8-филиалов-по-всеи-стране" tabindex="-1">8 филиалов по всей стране <a class="header-anchor" href="#_8-филиалов-по-всеи-стране" aria-label="Permalink to &quot;8 филиалов по всей стране&quot;">​</a></h3><ul><li>TechShop Mid Peninsula (temporarily located in San Carlos, CA)</li><li>TechShop San Francisco (San Francisco, CA)</li><li>TechShop San Jose (San Jose, CA)</li><li>TechShop Detroit (Allen Park, MI)</li><li>TechShop Austin-Round Rock (Round Rock, TX)</li><li>TechShop Pittsburgh (Pittsburgh, PA)</li><li>TechShop Chandler (Chandler, AZ)</li><li>TechShop DC-Arlington (Arlington, VA)</li><li>TechShop St. Louis <em>In Planning</em></li><li>TechShop Los Angeles <em>In Planning</em></li></ul><p>На конец 2014 года индивидуальное членство в компании, позволяющее получать неограниченный доступ к оборудованию и инструментам, рабочим станциям для дизайна и работы со специализированными программами любого из филиалов TechShop обходится в $120 — $175  в месяц в зависимости от срока оплаты (1 месяц, подписка или готовой абонемент). Плюс программы скидок для членов семьи и для студентов и сотрудников военной сферы.</p><p>И небольшая выдержка из раздела FAQ с сайта techshop.ws:</p><p><strong>В:</strong> Каковы часы работы Тэкшопа? <strong>О:</strong> Тэкшоп открыт с 9 утра до 12 ночи каждый день кроме праздничных.</p><p><strong>В:</strong> Вы можете показать, как пользоваться оборудованием и инструментами? <strong>О:</strong> Да! Мы предлагаем пройти классы по базовому безопасному использованию (SBU) чтобы быстро и безопасно ввести вас в курс дела.</p><p><strong>В:</strong> Какие виды классов предлагает Тэкшоп? <strong>О:</strong> Мы предоставляем несколько видов классов: - Классы по базовому безопасному использованию разработаны чтобы предоставить основные навыки безопасного использования тех или иных инструментов или оборудования, - Путевые классы предлагаются в качестве строительных блоков, способствующих продвижению ваших проектов к поставленным целям - Проектные классы дают четкие инструкции по специфическим техникам и технологиям, необходимым для завершения вашего конкретного проекта.</p><p><strong>В:</strong> Должен ли я быть членом чтобы посещать классы? <strong>О:</strong> Нет! Каждый может прийти на обучающие классы в Тэкшоп. (Есть ограничения по возрасту в целях безопасности)</p><p><strong>В:</strong> Какие инструменты и оборудование предоставляет Тэкшоп?<strong>О:</strong> <em>Без перевода:</em></p><blockquote><p>We provide our members access to just about every machine, tool and process that you can imagine, including milling machines and lathes, Epilog laser cutters, sheet metal equipment, welding equipment, an indoor automotive work bay, woodworking equipment including a 4&#39; x 8&#39; CNC ShopBot router, plastics working equipment, hand tools, a 3D printer, computer-controlled vinyl cutter, sewing machines, design software and lots more.</p></blockquote><p><strong>В:</strong> Я могу пользоваться любыми инструментами и оборудовании в мастерской? <strong>О:</strong> Да, если вы прошли обучение по базовому безопасному использованию ими, если это требует конкретный инструмент. Большинство инструментов и некоторые машины не требуют прохождения таких классов. Для обеспечения безопасности, мы все-таки требуем прохождения базового обучения для работы с любым оборудованием, способным нанести серьезные травмы.</p><p><strong>В:</strong> Могу я забронировать время работы на оборудовании? <strong>О:</strong> Да! При наличии активного членства вы можете забронировать время на любом оборудовании до своего прихода, позвонив в приемную Тэкшопа.</p>',16)),a(o,{link:"http://www.youtube.com/watch?v=hHAzPIsYj8M"})])}const f=n(p,[["render",c]]);export{_ as __pageData,f as default};
